import React from 'react';

const Sidebar = () => {
  return (
    <nav id="sidebarMenu" className="navbar navbar-expand-md bg-dark d-flex flex-column" style={{ height: '100vh', width: '200px', position: 'fixed', top: 0, left: 0 }}>
      <div className="container-fluid d-flex flex-column align-items-start pt-3">
        <ul className="navbar-nav flex-column w-100">
          <li className="nav-item">
            <a className="nav-link text-white" href="MenuPage">Menu</a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="Cart">Cart</a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="Profile">Profile</a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="Settings">Settings</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Sidebar;
